	/*=========================  createUserLogo ===========================
	 				Create  Blank User Logo if not Exist
	  =================================================================*/
	public void copyFile(String source, String destination) throws IOException{
		File fileLogo=new File(destination);
		if(!fileLogo.exists()){
			InputStream in = new FileInputStream(source);
			OutputStream out = new FileOutputStream(destination);
			byte[] buf = new byte[1024];
			int len;
			while ((len = in.read(buf)) > 0) {
				out.write(buf, 0, len);
			}
			in.close();
			out.close();	
		}
	}

	public List<UserFilesDownloadedDTO> getUserFilesListByOption(String userLogin,Boolean checkAllFiles,HttpSession session) throws ServiceException{
		List<UserFilesDownloadedDTO> result;
		if(checkAllFiles){
			result=orderService.getListFileDownloadedDTO(userLogin, 1, 3);
		}else{
			result=orderService.getListFileDownloadedDTO(userLogin, 1, 0);
		}
		session.setAttribute("userFilelist",result);
		return result;
	}
}

